INSERT INTO `event` (`id_event`, `judul_event`, `speakers_event`, `jadwal_event`, `waktu_event`, `lokasi_event`, `thumbnail_event`, `deskripsi_event`, `tiket_event`, `kuota`, `created_event`, `link_grup`, `event_status`, `show_event`, `urutan_show`) VALUES
(11, 'Finder 6: Concept Art Workshop: Warisan Dalam Goresan', 'Gina Fajri Aulia, Suryadi Maskat', '2024-09-28', '09.00 - 16.30 WIB', 'Auditorium FPSD UPI', '', '', 0, NULL, '2024-09-22 13:09:28', 'https://chat.whatsapp.com/IQgmRUJmvbCGaEETbTnxv4', 0, 1, 1),
(13, 'Unveiling the Creative Vision: Behind Finder 6 – Pustaka', 'Tegar Januarddy', '2024-10-23', '08:00 - 11:00', 'Auditorium FPSD UPI', '', '', 0, 0, '2024-10-02 11:36:15', '', 1, 0, NULL),
(18, 'Student Collective Movement And Entering The Design Profession', 'Bandung Design Friendly & Serving Idea', '2024-10-23', '23 Oktober 13.00 - 14.00', 'Auditorium FPSD Lantai 7', 'QR INCLUDED-gelar wicara-04_1729217781.png', 'diatas para pembicara dari Bandung Design Friendly mengenai \\\\\\\"Student Collective Movement and Entering the Design Profession\\\\\\\" Disini Kamu akan mendapatkan insight bagaimana kerja di industri desain grafis', 0, 184, '2024-10-13 06:08:34', '', 1, 1, 3),
(19, 'Neo-Indonesiana Dalam Karya Dan Jenama', 'Projek Agni', '2024-10-23', '23 Oktober 14.00 - 15.00', 'Auditorium FPSD Lantai 7', 'QR INCLUDED-gelar wicara-12_1729218442.png', 'diatas para pembicara dari Projek Agni mengenai \\\\\\\"Neo-Indonesiana dalam karya dan jenama\\\\\\\"', 0, 184, '2024-10-13 06:10:42', '', 1, 1, 3),
(20, 'Refleksi Budaya & Tradisi Desain di Indonesia', 'Aulia Akbar', '2024-10-23', '23 Oktober 15.30 - 17.00', 'Auditorium FPSD Lantai 7', 'QR INCLUDED-gelar wicara-09_1729217535.png', 'IKN Identity Section merupakan sub-program dari Dartspace yang menjadi ruang apresiasi khusus bagi Desainer Grafis Aulia Akbar dan POT Branding House yang turut serta dalam pembangunan besar Indonesia. Atas karyanya yang berkontribusi sebagai identitas visual Ibu Kota Nusantara.', 0, 184, '2024-10-13 06:12:41', '', 1, 1, 4),
(29, 'Finder x Japan Workshop: Ikebana (Rangkai Bunga)', 'Ayano Suzuki', '2024-10-24', '24 Oktober 09.10 - 09.40', 'Ruang Smartclass, Gd. FPSD Baru Lt. 2, Universitas Pendidikan Indonesia', 'japan-Loka karya-Ikebana_1729061756.png', 'Ikebana, lebih dari sekadar merangkai bunga, adalah seni mendalam yang memadukan alam dan harmoni. Temukan filosofi dan keindahan di balik setiap tangkai bunga bersama Ayano Suzuki, seorang ahli Ikebana langsung dari Jepang! . Jangan lewatkan kesempatan eksklusif ini untuk mempelajari teknik dasar Ikebana dan menciptakan rangkaian bunga khas Jepang yang penuh makna. Yuk, daftar sekarang dan nikmati pengalaman seni yang memikat! ', 0, 50, '2024-10-14 08:42:54', 'https://chat.whatsapp.com/IkWcVxJFejU5NF5GOTCdNu', 0, 1, 6),
(30, 'Finder x Japan Workshop: Shōdo (Kaligrafi Jepang)', 'Koichi Sakamoto', '2024-10-24', '24 Oktober 13.00 - 13.30', 'Ruang Smartclass, Gd. FPSD Baru Lt. 2, Universitas Pendidikan Indonesia', 'japan-Loka karya-Shodo_1729061818.png', 'Kamu cinta Jejepangan? Suka kaligrafi juga? Pengen coba interaksi sama orang Jepangnya langsung dan belajar budaya Jepang secara live dan gratis? Gas ikut Finder x Japan : Shōdo Workshop gak, siiihhh Disini kamu bisa belajar kaligrafi Jepang secara langsung sama ahlinya loh ‼️.Catat tanggalnya yaa Ditunggu kehadirannya ya, kimitachi ‼️', 0, 55, '2024-10-14 08:44:33', 'https://chat.whatsapp.com/JK7I1Q5hWS3JCPLGvVLBy8', 0, 1, 13),
(31, 'Finder x Japan Workshop: Kimono/Yukata', 'Monayo Koyano', '2024-10-25', '25 Oktober 15.30 - 16.00', 'Ruang Smartclass, Gd. FPSD Baru Lt. 2, Universitas Pendidikan Indonesia', 'japan-Loka karya-Kimono_1729061637.png', 'Yukata dan Kimono, pakaian tradisional yang merefleksikan keanggunan dan warisan budaya Jepang. Kini, kamu bisa mempelajari cara memakai Yukata dan Kimono langsung dari Manayo Koyano, pemateri dari Jepang! Rasakan pengalaman memukau dengan mempelajari detail serta cara memakai pakaian tradisional ini dalam workshop interaktif. Jangan sampai terlewatkan!\\\\r\\\\n\\\\r\\\\nKuota sewaktu-waktu dapat berubah', 0, 50, '2024-10-14 08:45:43', 'https://chat.whatsapp.com/LDUxk7wp6gBC1m8b5bg3Gd', 0, 1, 17),
(32, 'Post-Graduation Pathways: Perjalanan Setelah Kelulusan DKV UPI', 'IKA DKV UPI', '2024-10-23', '10.50 - 12.00', 'Auditorium Fpsd lt 7', 'IKA-01_1729221841.png', 'Menjelajahi Perjalanan Setelah Lulus Dari DKV UPI , Disini Para Alumni Akan Menceritakan Perjalanan Mereka Ke Dalam Dunia Karir Dan Memberikan Pengalaman Dan Saran Untuk Kamu', 0, 184, '2024-10-16 01:35:32', '', 1, 1, 2),
(33, 'Gerakan Ekonomi Kreatif Nasional', 'Gekraf', '2024-10-24', '24 Oktober 08.10 - 09.10', 'Auditorium FPSD lt 7', '../../img/event/1729050423_image 21.png', '.', 0, 100, '2024-10-16 03:47:03', '.', 2, 0, 5),
(34, 'Visual Voices : Redefining Design As Value Creation & Digital Culture In State Hegemony ', 'Nanang Ganda Prawira & Eka Sofyan', '2024-10-24', '24 Oktober 09.00 - 10.20 WIB', 'Auditorium Lt 7', 'gelar wicara-15_1729405862.png', '.', 0, 184, '2024-10-16 03:49:20', '.', 1, 1, 7),
(35, 'Finder X Japan : A Guide Of Japanese Culture', 'Yu Yoshioka , Ayano Suzuki', '2024-10-24', '24 Oktober 10.20 - 12.00 WIB', 'Smart Class lt2 gd. Fpsd', 'IKA-09_1729405653.png', '.', 0, 40, '2024-10-16 03:51:09', '.', 1, 1, 8),
(40, 'Metaverse and Asian Culture: Myth Sentinels as a Bridge Between Digital and Traditional Worlds', 'Sangnila', '2024-10-24', '24 Oktober 13.00 - 14.00 WIB', 'Auditorium FPSD lt7', 'gelar wicara-19_1729405524.png', '.', 0, 184, '2024-10-16 04:32:07', '.', 1, 1, 14),
(41, 'Animation Technology in the Gaming Industry', 'Lentera Nusantara', '2024-10-24', '24 Oktober 14.00 - 15.00 WIB', 'Auditorium Fpsd lt 7', 'gelar wicara-01_1729405452.png', '.', 0, 184, '2024-10-16 04:35:08', '.', 1, 1, 15);
