INSERT INTO `karya` (`id_karya`, `judul_karya`, `nama_karya`, `instagram`, `deskripsi`, `id_jenis`, `created_at`, `likes`, `comments`, `pict_karya`, `optional_karya`, `NIM`) VALUES
(14, 'Into The Underwater Life', 'Belva Fithriyah Salsabilla ', 'belva_f.s', 'Sebuah eksplorasi magis dalam kehidupan futuristik di bawah samudra.', 7, '2024-07-19 10:06:25', 6, 0, '1721383585_669a3aa170f9b.png', NULL, 22),
(15, 'The Little Girl running with baloon', 'Syifa Siti Fatiya', 'syifafatiya.03', 'Waktu aku kecil saat berlari di padang rumput yang dibawah kakiku terdapat bunga, ibu menyahutiku dari jauh “Nak tunggu ibu bawa buku gambar dulu. JANGAN LARI TERLALU KENCANG, GAMBAR KARAKTER CHIBIMU BELUM SELESAI!!!!!” ', 7, '2024-07-19 10:09:41', 3, 0, '1721383781_669a3b65917eb.jpeg', NULL, 22),
(16, 'Make A Wish', 'Raissa Nathania', 'raissa.nth', 'With each candle blown and cake cut, may each birthday bring you closer to your wishes.', 7, '2024-07-19 10:11:35', 3, 0, '1721383895_669a3bd75f301.png', NULL, 22),
(17, 'Sky Adventure', 'AHIMSA TAKBIR YAMA', 'yamaahimsaa', 'A young boy rides a luminous water dragon, soaring above a glowing city under the starry night sky.', 7, '2024-07-19 10:15:04', 3, 0, '1721384104_669a3ca8761d7.png', NULL, 22),
(18, 'Chihiro & Haku', 'AHIMSA TAKBIR YAMA', 'yamaahimsaa', 'Chihiro and Haku running and escaping on top of a train. ', 7, '2024-07-19 10:16:25', 3, 0, '1721384185_669a3cf94f3bc.png', NULL, 22),
(19, 'Katarina', 'Nadya Putri Ramadhani', 'queenoiec', '\"Let the light within you shine, like the crystals that adorn her face.\" (The fanart of Katarina Yu)', 8, '2024-07-19 10:21:58', 10, 2, '1721384518_669a3e46c3fbf.png', NULL, 22),
(20, 'Jabarkan Indonesia', 'Ibnu Djayyid Zidan', 'djayyidz', 'Pada poster ini saya ikut lomba kan pada kompetisi jabarkan indonesia di tahun 2023, dengan detail saya membuat karya ini melalui software adobe Illustrator, setiap pewarnaan dan character saya sesuaikan sehingga timbul cita rasa yang mistik dan meriah.', 9, '2024-07-19 10:29:24', 5, 0, '1721384964_669a40045c089.jpeg', NULL, 22),
(21, 'Shade Whisper', 'Laras Maharani', 'chizue0098', 'Karakter misterius yang memiliki kemampuan berkomunikasi dengan makhluk gaib atau roh. Dia bisa menjadi pemandu atau pelindung, menjelajahi dunia yang tersembunyi dengan penutup mata untuk mendengarkan bisikan yang tak terlihat.', 7, '2024-07-19 10:35:52', 8, 2, '1721385352_669a41887f1b5.jpg', NULL, 22),
(22, 'Thoughts', 'Viana Catleya ', 'catyela_', 'No medication\'s ever made them stop.', 7, '2024-07-19 10:39:17', 5, 0, '1721385557_669a425558ae6.png', NULL, 22),
(23, 'Innocent Soul', 'Rohim Hidayat', ' _himmh', 'when the sunlight comes and passes through the leaves, you can see a little fairy sleeping on one of the leaves, his innocent soul and soft heart spread a positive aura. like the light that humans first see when they are born.', 7, '2024-07-19 10:41:30', 3, 0, '1721385690_669a42daeb7de.jpeg', NULL, 22),
(24, 'Costasiella Kuroshimae', 'Giska Alfiarimala', 'gska_alfrimla', 'Karya ini terinspirasi dari salah satu hewan, ia adalah \'Sea Sheep\' atau domba laut. Sea Sheep memiliki nama ilmiah lain yakni Costasiella Kuroshimae, maka dari itu karya ini berjudul \'Costasiella Kuroshimae\'. Costasiella Kuroshimae merupakan sejenis siput yang dapat berfotosintesis dengan bantuan alga yang dimakannya. Sesuai referensi, mereka terlihat cantik dari jarak dekat dan tampak bersinar dengan kombinasi-kombinasi warna yang mereka miliki.', 7, '2024-07-19 10:42:46', 3, 0, '1721385766_669a43266630b.jpg', NULL, 22),
(25, 'My Dear Merman', 'Rossaredflyn', 'rossaredflyn_', '-', 7, '2024-07-19 10:43:46', 3, 0, '1721385826_669a4362b52d7.png', NULL, 22),
(26, 'Fairy Goddess', 'Destri Sulistiya Nurrizki', 'brizdt', 'seorang peri yang sedang menyendiri menerangi gelapnya malam', 7, '2024-07-19 10:44:53', 3, 0, '1721385893_669a43a5c8764.png', NULL, 22),
(27, 'Satisfaction or Revenge?', 'Dhea Ayu Septiani Nur Faddillah', 'https://x.com/catnamefuu', 'Memperlihatkan karakter Luara yang mengambil kekuatan di dalam kuil, namun mengapa dia melakukan itu?apakah dia menginginkan kekuatan sebagai balas dendam akan ketidakadilan yang dia dapat, balas dendam atas neneknya atau hanya untuk kepuasan tersendiri? ', 7, '2024-07-22 10:10:25', 5, 0, '1721643025_669e30116c0ef.png', NULL, 2100332),
(29, 'FPSD & FPEB', 'Ucu Muhammad Nur', 'asteriart95', 'Universitas Pendidikan Indonesia (UPI) dengan bangga mempersembahkan gedung baru FPSD dan FPEB. Karya ini merayakan keberhasilan pembangunan yang megah dan menyambut atmosfer segar yang dihadirkan oleh gedung-gedung baru ini bagi para mahasiswa. Gelembung melambangkan pandangan hidup yang ringan dan penuh kegembiraan, mengajak kita untuk menghargai momen-momen kecil yang indah, seperti saat kita meniup gelembung sabun. Momen berharga ini tercipta dari perjalanan panjang, mulai dari gedung lama hingga kelahiran kembali dalam bentuk gedung baru yang menginspirasi.', 1, '2024-07-22 10:36:21', 8, 0, '1721644581_669e362591524.png', NULL, 2102072),
(30, 'Badger x Scarlett Crossover ', 'Siti Nurhaliza', 'zero._.annn', 'Poster Design of Original Characters insert to Call Of Duty Universe. Gaya Poster di desain sesuai dengan tema hitam dengan sentuhan garis hijau ala Call Of Duty: Modern Warfare II', 7, '2024-07-22 10:41:57', 4, 0, '1721644917_669e3775c1751.PNG', NULL, 2100492),
(31, 'Farewell', 'Teuku Muhammad Daffa Arullah', 'theemdep', 'Memori seorang gadis di masa sekolahnya, membanjiri di akhir masa kelulusannya', 7, '2024-07-22 11:49:42', 7, 0, '1721648982_669e47563504d.jpg', NULL, 2307838),
(32, 'Gedung Isola', 'Zheeba Dara Anjali ', 'zwedaraa', 'Potret mahasiswi yang memandangi gedung Isola setelah menghabiskan waktunya mengobrol di Taman Bareti.', 4, '2024-07-22 11:53:01', 3, 0, '1721649181_669e481d0f527.jpg', 'https://drive.google.com/open?id=1BQ0Sea1E0-HusmuWHKSNbu7jryfdVXxy', 2301515),
(33, 'Annerose\'s Elf', 'Trisha Meutya Fairuza', 'norakumo__', 'Annerose bersandar pada seorang elf berambut biru dengan mata crimson bernama Lou. Di bawah langit cerah membentang luas, keduanya menghadap ke arah mata angin yang berbeda.', 7, '2024-07-22 11:54:16', 16, 0, '1721649256_669e4868047a9.jpg', 'https://drive.google.com/file/d/1w8IJqtneeVMMm_LUis41iwQPPpcABOag/view?usp=sharing', 2301039),
(35, 'Me and Father', 'Ang Nia Agustina', 'poprongart_', 'When I was 7y.o, I went to Timezone for the first time, and it looked so incredible and interesting. My sister captured the moment when me and my father were riding the dino!!! It was very funnn!, and I wanted to make that moment everlasting in my heart. That\'s why I drew this to remember how happy I was with my father.', 7, '2024-07-22 11:55:56', 5, 0, '1721649356_669e48cc98bb7.jpg', 'https://drive.google.com/open?id=1b3T6ypdB8TfzQ7Wf75Jp8XzzyJWJb1hM', 2301188),
(36, 'The Struggle to Love Ourselves', 'Athira Zalfadya Mufidza', 'athieera', 'Zine ini adalah tentang upaya untuk menerima kenyataan bahwa kita tidak sempurna, dan tetap berusaha untuk mencintai diri kita sendiri.', 1, '2024-07-22 11:58:06', 6, 0, '1721649486_669e494e529ad.jpeg', 'https://drive.google.com/open?id=1z71JW7dFJSXp4Eo-aipIhgMwCQQLgLPV', 2307270),
(37, 'Kopi Aroma', 'Edlianna Taka Munandar', 'takukazan', 'Redesign kemasan Kopi Aroma pada pelaksanaan Lomba Kompetisi Siswa (LKS) Tingkat Provinsi Jawa Barat Tahun 2023. Dibuat dalam sajian sashet modern yang lebih praktis tapi tetap mengandalkan unsur jadulnya kopi aroma', 5, '2024-07-22 11:59:49', 5, 0, '1721649589_669e49b511432.jpg', 'https://drive.google.com/open?id=1vBTFp4FWmRjoiwnylhdk2Uv8RWNkpMkz', 2310260),
(38, 'YUCK', 'Athira  & Vanya ', 'athieera', 'type specimen zine tentang font yang menggambarkan rasa jijik.', 5, '2024-07-22 12:01:39', 4, 0, '1721649699_669e4a239957c.jpeg', 'https://drive.google.com/open?id=1i96eXIqaBttstITgO55EBuj7pkv86zqX', 2307270),
(39, 'Donat Legendaris Blender 3D', 'MUHAMMAD THORIQ EL RIDWAN', 'thoriq.proo', 'Sepiring donat yang membumihanguskan laptop admin.\r\nDibuat di Blender', 7, '2024-07-22 12:04:20', 5, 0, '1721649860_669e4ac42c687.jpg', 'https://drive.google.com/drive/folders/1DiPJrp7BJijKfZGZixDoaeNf0m6gG0yg?usp=sharing', 2300518),
(40, 'Nilam dan angklung', 'Nayyara Atifa Khaira ', 'nanayyaira_', 'Seorang gadis bernama Nilam, yang menggunakan kebaya hijau dan sedang memainkan alat musik tradisional; Angklung ', 7, '2024-07-22 12:08:51', 15, 0, '1721650131_669e4bd33bcf7.jpg', 'https://drive.google.com/file/d/1isRCGwyOZIRc-3T2us8lF9QdAv696boe/view', 2304166),
(41, 'Take A Break', 'Aulia Novita Hasna', 'luloody_', 'Terkadang, kita perlu menyisihkan waktu dari rutinitas yang melelahkan untuk berhenti sejenak dan menikmati kehidupan dengan melakukan hal-hal yang kita sukai.', 7, '2024-07-22 12:09:07', 11, 0, 'takeabreak.png', 'https://drive.google.com/drive/folders/1VblVROLLJlSVKkIZ5agGw3DovHTk5KMU', 2312599),
(42, 'Heart of the sea', 'Saepul Mu\'minin', 'saepul_muminin_', 'Sang legenda, putri dari laut selatan yang disebut dengan nama kadita, penguasa lautan dengan tombak kebanggaannya untuk melindungi samudra. Terinspirasi dari pulau bali, kini kadita memakai pakaian yg mencerminkan adatnya, dengan memakai kemben dengan motif batik dan gapura serta bunga kamboja. ', 7, '2024-07-22 12:12:05', 14, 1, '1721650325_669e4c953fccb.jpg', 'https://drive.google.com/open?id=1lq7Y8F5kgNUy8ugoG8UzuR2VJ4RnF9o_', 2300059),
(43, 'Javanese Traditional dancer', 'Naomi Cleodia Darenoh', 'naomidrnh', 'Indonesia dikenal dengan keragaman budaya di setiap daerah, dari Sabang sampai Marauke. Terutama keragaman budaya di pulau Jawa yang sangat melimpah. Pada karya saya kali ini, saya melukiskan seorang perempuan penari Jawa dengan elemen dekoratif yang sungguh menarik serta tambahan tambahan corak kebudayaan Jawa di belakang sang penari. Pada latar background saya menggambarkan sosok keris dan kipas Jawa yang melambangkan kedaulatan suku Jawa. Keris ialah simbol kepahlawanan dan sikap kesatria, sehingga perpaduan antara penari tradisional dan Keris tersebut mengartikan penari-penari tradisional Indonesia yang cantik dan anggun namun perkasa dalam dirinya', 7, '2024-07-22 12:12:43', 6, 0, '1721650363_669e4cbba8cd8.png', 'https://drive.google.com/open?id=1ZLUl2snYxaQmTtlvGLwjA5YcZmCzBf0Y', 2305012),
(44, 'The Man Behind the Mask', 'Muhamad Virgi Nanda', 'livinsoloud_', 'Joker, nama aslinya Ren Amamiya (atau Akira Kurusu dalam manga), adalah pemimpin karismatik dari Phantom Thieves of Hearts. Dengan rambut hitam dan mata tajam di balik kacamata, dia menyembunyikan identitas ganda sebagai siswa SMA dan pejuang melawan kejahatan di dunia metaverse. Memiliki kemampuan unik untuk mengendalikan banyak Persona, Joker adalah sosok yang cerdas, tangguh, dan penuh tekad dalam misinya untuk mengubah hati mereka yang korup dan membawa keadilan. Setiap langkahnya adalah simbol pemberontakan, menjadikannya pahlawan modern dalam bayang-bayang malam Tokyo.', 1, '2024-07-22 12:16:37', 5, 0, '1721650597_669e4da5b9856.png', 'https://drive.google.com/drive/folders/107qvDydPmQPutney4WJ6G2OVq401Izhx?usp=sharing', 2312544),
(45, 'Timun Mas', 'Fathiyah Ramadhani Azmi ', 'fathiyah.azmi05', 'Ilustrasi digital dari karakter Timun Mas dalam rangka merayakan HUT RI ke-78 ', 7, '2024-07-22 12:17:40', 8, 0, '1721650660_669e4de4b5e89.jpg', 'https://drive.google.com/file/d/14zpPDDZs2V7n6VO0x8LkaO30C7P2W7IU/view', 2304252),
(46, 'Aimee Beads', 'Vika Zahra Denisa', 'vikazd', 'Desain produk untuk kemasan aimee beads yang memiliki branding aksesoris yang colorfull, imut,  namun tetap terkesan elegan yang hadir dengan box packaging besar untuk aksesoris, kartu terimakasih dan kartu petunjuk penggunaan, stiker, serta alas packing untuk aksesoris. ', 1, '2024-07-22 12:18:24', 9, 0, '1721650704_669e4e1051aed.jpeg', 'https://drive.google.com/open?id=1XeraRTd-4mxQ5CZqMidDogBguxGEBq9P', 2301498),
(47, 'The Nightshade Fortress, Yvaine', 'Rachmi Maulida Lestari', 'withlovesrach', 'Karya ini bertajuk \"The Nightshade Fortress, Yvaine” yang bertemakan karakter fantasy. Yvaine, karakter utama dalam ilustrasi ini, dianugerahi kemampuan untuk menghasilkan cahaya dari tangannya, memberikan harapan dan perlindungan dalam kegelapan malam. Cahaya yang dipancarkan dari tangannya tidak hanya berfungsi sebagai penerang tetapi juga sebagai senjata mematikan dalam bentuk pisau semu yang ia lemparkan untuk melawan makhluk-makhluk kegelapan.\r\n\r\nYvaine mengenakan sebuah dress yang menyerupai merak. Merak dipilih sebagai simbol utama dalam desain pakaian Yvaine, melambangkan keindahan, perlindungan, dan kekuatan melawan segala bahaya serta pengaruh buruk. Gaun ini tidak hanya mencerminkan keanggunan dan kecantikan Yvaine tetapi juga memperkuat auranya sebagai penjaga malam yang misterius dan kuat.\r\n\r\nKarya ini dibuat secara digital menggunakan Adobe Photoshop dan Ibis Paint X, Teknik yang digunakan ialah Teknik grayscale to color kemudian dilanjutkan dengan proses finishing termasuk dengan finishing pencahayaan agar ilustrasi ini tampak lebih hidup.', 7, '2024-07-22 12:24:38', 8, 0, '1721651078_669e4f86893e4.png', 'https://drive.google.com/drive/folders/1CwKHyYkDCZXRYUY69SkkJdSq4UDzN0WS?usp=sharing', 2304042),
(48, 'RAHIM IBU', 'Salsabilla Nuur Agustin', 'sal.billaa_', '\"Di dinding rahim ibu,\r\nterdapat prosa yang tiap katanya,\r\nterukir dari deru nafasmu.\r\nLantunan doamu yang tak henti-hentinya menyapaku, menjadikan rahimmu, tempat ternyaman untuk menyemayamkan tubuhku.\r\nDi dalam rahim ibu, aku mengadu rindu.\"', 4, '2024-07-22 12:26:13', 6, 0, '1721651173_669e4fe589ede.png', 'https://drive.google.com/open?id=1r0Jq83vzRwPgYnZIXJMQAvvf6ryuvJ0y', 2301074),
(49, 'Nyi Rengganis', 'Putria Rehna Nurani', 'skyenss', 'Nyi Dewi Retna Rengganis merupakan seorang putri yang cantik jelita dari Keraton Djamin di Tanah Parahyangan. Di latar belakangi Taman Banjarsari yang mempesona, suasana asri dan penuh warna mencerminkan keindahan dan kedamaian. Kupu-kupu yang bersinar yang mengelilinginya menambah sentuhan magis di sekitar sang putri. Nyi Rengganis juga memiliki kekuatan unik yaitu ketika ia menangis, air matanya dapat menciptakan genangan yang menenggelamkan sekitarnya dan mengubahnya menjadi sosok agung dengan pakaian kebesaran kerajaan.', 7, '2024-07-22 12:29:45', 6, 0, '1721651385_669e50b945d5d.png', 'https://drive.google.com/open?id=1FbDaN8pACdEGI9-sytjrR_DyR05h_ZAs', 2301591),
(50, 'SRI ASIH', 'Hanifah fauziah wisnugroho', 'hnffa_h', 'Sri Asih menjadi pahlawan fiksi asli Indonesia yang menjadi cerminan wanita Indonesia. Parasnya yang cantik, kekuatannya untuk mengalahkan kejahatan dan keberanian yang seluas samudera adalah poin penting yang harus ada pada setiap wanita di Indonesia. ', 7, '2024-07-22 12:35:27', 5, 0, '1721651727_669e520f2285e.png', 'https://drive.google.com/file/d/1hcNTjYhimpT2EUy_aaCAwYTiL0Q_A3dd/view?usp=drivesdk', 2304792),
(51, 'Gelembung', 'Najwa Futhana Ramadhani', 'nas.ss_', '\"Shot : f/5,6; ISO 400; SS 1/100s\r\n\r\nge·lem·bung/ n  bentuk bola-bola yang berisi udara; bola-bola  air ( air sabun, buih, dan sebagainya) yang berisi udara.\r\n\r\nFoto ini di-capture dengan teknik bokeh untuk memperkuat kesan \"\"bulat\"\" pada foto. Walau begitu, dengan menggunakan komposisi centre, memfokuskan mata pelihat kepada gelembungnya saja sebagai titik fokus utama. \"', 4, '2024-07-22 12:37:48', 3, 0, '1721651868_669e529c752ba.jpg', 'https://drive.google.com/open?id=1PtBm_qBSGtVp1yQ0UkOqXMF9QJ7U6bRX', 2300323),
(52, 'Rahwana dalam Tari Topeng Cirebon ', 'Lia Amaliyyatussolihah ', 'malikalafiyu ', 'Tari Topeng Cirebon Kelana, atau sering disebut juga Tari Topeng Rahwana, adalah salah satu tarian tradisional yang berasal dari Cirebon, Jawa Barat. Tarian ini menggambarkan sosok Rahwana, seorang tokoh antagonis dari epos Ramayana yang menampilkan sifat angkuh dan tempramental. Untuk menampilkan sifatnya, penari menggunakan topeng berwarna merah dan kostum yang mencolok, serta gerakan yang dinamis dan ekspresif.', 7, '2024-07-22 12:41:24', 16, 0, '1721652084_669e537403726.jpg', 'https://drive.google.com/open?id=1mRW-2t0T92vc-RR7XL8l7R43sst5XJqI', 2307921),
(53, 'Khodam', 'Dhaffa muhammad ammar', 'dhapps_17', 'Poster ilustrasi ini menggambarkan tentang khodam yaitu robot unit 03, yang selalu berada di samping tuan-nya yang bekerja sebagai teknisi di perusahaan teknologi robotik dan A.I Indonesia.', 1, '2024-07-22 12:44:05', 8, 0, '1721652244_669e5414f377b.png', 'https://drive.google.com/open?id=1QYZfr2L64cXKr8L8E0Z6LBMF6FRat2ab', 2301154),
(54, 'Dayang Sumbi', 'Romauli Amanda', 'romauliarts', 'Seorang wanita sekaligus ibu yang memiliki perawakan cantik abadi. Akan tetapi karena kecantikannya tersebut, anak kandungnya bernama Sangkuriang kehilangan akan akal sehatnya dan berkeinginan memperistri sang ibu.', 7, '2024-07-22 12:46:52', 10, 0, '1721652412_669e54bc6a952.jpg', 'https://drive.google.com/open?id=1M472NDAL567eXxDq-JENWAD4B8siXgYX', 2312190),
(55, 'Story of Nara', 'Aqmarina Nurhasna Hidayat', 'aqmarinanh', 'Perjalanan seorang gadis kecil bernama Nara dan kucing kesayangannya untuk menjadi apapun yang dia inginkan, dengan bantuan tongkat ajaibnya. ', 7, '2024-07-22 12:50:40', 18, 1, '1721652640_669e55a036ae2.jpg', 'https://drive.google.com/file/d/1gGh9JO8YH4uHOTBWcZkeIfOCPuCNAaiY/view?usp=drivesdk', 2305850),
(56, 'Hands For Gaza ', 'Nayla Rachma Febriani ', 'nalaooz', 'Poster ini dibuat sebagai pengingat bahwa siapapun kita, mari kita tolong keluarga kita di Palestina sana tanpa memandang darimana asal kita.', 7, '2024-07-22 12:53:14', 7, 0, '1721652794_669e563a6a1f6.png', 'https://drive.google.com/open?id=1ygmnAQQ4LAsvaz_YfFnaixfCK85hO6CK', 2303719),
(57, 'kamu tidak meninggalkan saya, saya yang membiarkan kamu pergi', 'Mega aulia ', 'fu_miyami', 'Seseorang yang pernah merasakan kehilangan sesuatu mengira bahwa hal tersebut merupakan miliknya selamanya. Namun, pada akhirnya ia akan menyadari bahwa di dunia ini tidak ada satu pun yang akan menjadi miliknya', 7, '2024-07-22 12:54:24', 9, 0, '1721652864_669e5680ed85b.jpg', 'https://drive.google.com/open?id=18PlI7FPj-5biKOmXMwiNRRKic7hVWKzx', 2306322),
(58, 'Nusantara Bersama', 'The Hijack', 'thehijacks', 'Indonesia terdiri dari ragam budaya yang berhasil kami torehkan dalam satu karya bersama. Tiap gores pena memiliki citanya sendiri sesuai dengan budaya Indonesia, meski kami memiliki gaya berbeda, kami mampu menciptakan ilustrasi dalam satu padu yang pas. Kami akan turut senang jika karya kami diminati olehmu yang sedang membaca dan melihat karya kami! \r\n<br>\r\n<br>\r\nkayla (2301725) icham (2306036) jesse (2306198) anet (2300143) jesi (2306113) mine (2305932)', 7, '2024-07-22 12:55:13', 11, 0, '1721652913_669e56b1e2ee3.png', 'https://drive.google.com/file/d/1Of-LQn7FKzflGOKbS2J68N_qifQmiCCd/view', 23),
(59, 'Lonely', 'Lariks Syiar Grazio Mutika', 'Rien.Syika.02', 'Seorang laki-laki yang berjalan sendirian di jalan sepi. ', 7, '2024-07-22 12:55:47', 3, 0, '1721652947_669e56d3d9c30.png', 'https://drive.google.com/open?id=1uZ616OwzSvR_-GR23TM8TBb2gny1APqB', 2309394),
