(61, 'Barong x rangda', 'Akmal hakim', 'murayamal_', 'Menghidupkan kembali legenda Bali melalui ilustrasi Barong dan Rangda. Simbol kebaikan dan kejahatan bertemu dalam pertarungan epik yang penuh warna dan detail. Merasakan kekuatan dan keindahan mitologi Bali dalam setiap goresan.', 7, '2024-07-22 12:58:36', 9, 0, 'BarongxRangda.jpg', 'https://drive.google.com/open?id=1frdeJmf-pj_dkb0hdSl-3eHwA3sPE_hF', 2309054),
