(63, 'The Lady of War', 'Najwa Ayesha Rusydi ', 'Misss.salad', 'Kepribadian elok dengan tangan pedang yang cekat, nyonya muda Adiratna suka bertempur akan tetapi hati merindu kecantikan seorang wanita ( Sebuah karya mengenai cerita OC seniman )', 7, '2024-07-22 13:01:24', 5, 0, '1721653284_669e5824adb1f.jpg', 'https://drive.google.com/open?id=1DBEt160aVY12yok3liarUN2ciieEXiMd', 2304499),
(64, 'kula daut', 'Muhammad Azril Ilham', 'azrilmabruli', 'Kuda laut yang berkepala kuda, imajinasi dari si anak yang menungganginya. Seakan imajinasi anak kecil sangat random namun menyenangkan ', 7, '2024-07-22 13:02:19', 5, 0, '1721653339_669e585b4c724.jpg', 'https://drive.google.com/open?id=1DBEt160aVY12yok3liarUN2ciieEXiMd', 2301090),
(65, 'PoPin Candy', 'Salsabilla Nuur Agustin', 'sal.billaa_', 'Merupakan dokumentasi Pameran Angkatan Baru (PAB) dari Mahasiswa desain komunikasi visual angkatan 2023 yaitu Ronamaya. Candy box dengan desain yang menceritakan anak kecil sedang mencoba rasa rasa baru dalam indra pengecapannya', 5, '2024-07-22 13:05:25', 10, 0, '1721653525_669e59152871d.jpeg', 'https://drive.google.com/file/d/1egfMT0G73NbrDitAvxWyMVUuxnpgX4YG/view?usp=drive_link', 2301074),
(66, 'The Swan Dance', 'Fitri Andriani', 'philooarts_', 'Sungai atau danau yang dipenuhi angsa adalah tempat favorit Odilia untuk menari. Angsa, air, dan hewan lain disekitarnya seolah ikut andil dalam tariannya, membentuk harmoni yang indah. Odilia akan menari sampai akhir hidupnya untuk melestarikan tarian dari nenek moyangnya.\r\n', 7, '2024-07-22 13:25:38', 10, 0, '1721654738_669e5dd2ba29e.png', 'https://drive.google.com/file/d/1DTYzkDDf70Tdne7Q4KMP1PcuiJryLKrw/view?usp=drivesdk', 2300906),
(67, 'The Vivacious Gaze', 'Cindy Subang Larang', '_Subanglarang', 'In hues of green and blue so bright, \r\nHer soul\'s reflection dances with light. \r\nIn her deep irises, beauty glides, \r\nWhere wonders bloom inside', 4, '2024-07-22 13:27:00', 7, 0, '1721654820_669e5e249b328.png', 'https://drive.google.com/file/d/15cE1F72H_aT9cdBRu6SN1r8Cz71wVTKJ/view?usp=drive_link', 2305890),
(68, 'Mirror - mirror on the wall', 'Nauf Fhellida Felesia', 'lzhxia', 'The moment when you staring at yourself and start thinking about who you are, who is the person in front of you?', 7, '2024-07-22 14:23:51', 8, 0, '1721658231_669e6b7770bab.png', 'https://drive.google.com/file/d/15X9oPqPO6t17RCPP980YO9MCq3XgeS7m/view?usp=drive_link', 2305911),
(69, 'Serendipity\'s Refuge', 'Muzaky Akbar', 'muzakiakbar_', 'Indonesia :  Kisah dua jiwa muda dalam keberagaman kehidupan, bertemu pada saat yang tak terduga di tengah waktu dan ruang yang sempit. Di sinilah, di tengah hiruk-pikuk kehidupan, mereka menemukan tempat berlindung—suatu tempat yang harmonis di mana mereka saling menganyam, memberi penghiburan dan kekuatan. Bersama-sama, mereka menjadi sumber kebahagiaan dan inspirasi bersama, menciptakan pelarian yang indah dari kerumitan dunia mereka.\r\n<br>\r\n<br>\r\nEnglish : In the tapestry of life, there exists a poignant tale of two souls, each carrying their own burdens, who fortuitously intersected at a singular moment in time and space. Here, amidst the chaos of existence, they found refuge—a harmonious sanctuary where they intricately wove together, offering solace and strength. Together, they became beacons of happiness and mutual inspiration, creating a sublime escape from the complexities of their worlds.', 7, '2024-07-23 19:53:03', 6, 0, '1721764383_66a00a1f9495b.jpg', 'https://www.instagram.com/p/C8P1Cf0Skw5/', 2202304),
(72, 'Mitologi Hari Galungan', 'Ni Made Nadia Udanti', '', 'Dalam sebuah medan pertempuran yang membelah langit dan bumi, Bhatara Indra, menghadapi Mayadenawa raja yang sombong dan bengis dalam pertarungan epik. Di satu sisi, keberanian dan keadilan melalui gada keramat Bhatara Indra bersinar terang, sementara di sisi lain, kegelapan dan keangkuhan terpancar dari tubuh besar Mayadenawa. Di tengah-tengah pertarungan ini, nasib alam semesta bergantung pada hasilnya, mempertaruhkan keseimbangan antara kebaikan dan kejahatan.', 14, '2024-10-18 10:04:06', 1, 0, '1729245845_671232953197c.png', NULL, 0),
(73, 'Night of The Legends of Indonesian Forklore', 'Nugi Prasetya Nugraha', '', 'in this artwork, taling the mascal moment when characters from Indoneslan folktales\r\ncome together, serving the spirit ofithe campfire that radiates Warmtriandipostagis. The Dalang, as the embodiment of a master storyteller, creates a moment where Roro Jong-grang, Sangkuriang, Timun Mas, and other characters unite in harmony. listening to the stories that have enchanted our hearts since anildhood. This illustration also reminds Us of the rich cultural wealth and extraordinary heritage hidden within our folktales, inviting to cherish and celebrate it', 14, '2024-10-18 11:04:02', 1, 0, '1729249442_671240a2df1dd.png', NULL, 0),
(74, 'Pesona Budaya Nusantara', 'Farah Falisha Putri Endrawan', '', 'Tarian Nandak Ganjen merupakan tarian asal Betawi. Gerakannya yang elok tak pernah gagal memikat mata mereka yang menyaksikan, dan dengan mudah menjadi pusat perhatian. Dalam menggambarkan pesona keberagaman budaya Indonesia, pada ilustrasi sang penari diiringi oleh alat musik dari berbagai daerah, serta kebudayaan Indonesia lainnya seperti Tari Topeng dari Cirebon dan Kuda Lumping dari Jawa Tengah.', 14, '2024-10-18 11:07:24', 1, 0, '1729249644_6712416c71048.png', NULL, 0),
(75, 'Melor', 'Muhammad Fajar Gemilang', '', 'Karya ini tersinspirasi dari lagu klasik melayu yang berjudul \"Bunga Melur\". Menggambarkan wanita melayu yang anggun bersanggul yang dihiasi bunga melur, yakni sejenis bunga melati.', 14, '2024-10-18 11:09:33', 1, 0, '1729249773_671241edb12a5.JPG', NULL, 0),
(76, 'Keep Rocking With Astrajingga', 'Deny Chaidar Valentino', '', 'A remebrance of Astrajingga that always cherished every moments and stay energized for anything. He tells us to stay and always rockin\' till the end.', 14, '2024-10-18 11:11:47', 1, 0, '1729249907_6712427370d9e.jpeg', NULL, 0),
(77, 'Tari Kecak Bali', 'Bella Rachmadini Zeihan', '', 'tari kecak atau seni tari Kecak merupakan tarian yang berasal dari Bali. pada umumnya tari Kecak dimainkan oleh penari laki-laki yang duduk berbaris membentuk lingkaran.', 14, '2024-10-18 11:13:56', 1, 0, '1729250036_671242f4de127.png', NULL, 0),
(78, 'Harmoni Ondel-Ondel & Perjuangan Kelestarian Alam', 'Fadhlirrahman Hilmi', '', 'Ondel-Ondel merupakan boneka besar yang sering digunakan dalam parade di Jakarta sebagai simbol untuk membawa keberuntungan dan penjaga dari nasib buruk. Penempatan boneka Ondel-Ondel didalam hutan merupakan interpretasi sebagai simbol perlindungan dan harmoni antara tradisi masyarakat betawi dan alam disana. Ondel-Ondel juga merupakan representasi dari harapan dan kekuatan budaya akan kelestarian lingkungan untuk menjaga keseimbangan ekologis dan budaya.', 14, '2024-10-18 11:17:38', 1, 0, '1729250257_671243d1735b1.png', NULL, 0),
(79, 'Hudoq Dayak Tribe', 'Cahyannisa Andriasih', '', 'Ritual tarian bertopeng ini masuk golongan kesenian tari topeng yang melambangkan do\'a permohonan agar mendapatkan hasil pertanian yang melimpah dan terhindar dari hama yang digelar oleh sub-etnis Dayak di provinsi Kalimantan Timur. Hudoq merupakaan jelmaan dari roh (dewa) yang menggunakan topeng agar bisa berhubungan dengan manusia. Menurut tradisi, festival hudoq diadakan setiap selesai menugal (menanam padi) di ladang September-Oktober setiap tahun yang bermakna memohon berkat Tuhan agar padi yang ditanam nanti menghasilkan bulir yang berlipat-lipat hingga membawa kemakmuran bagi masyarakat. Penari hudoq Bahau dan Modang memakai topeng kayu berukir. Seluruh tubuh penari tertutup busana yang terbuat dari kulit pohon, dihiasi rumbai daun pisang. Busana dilengkapi dengan topi berbulu dan tongkat kayu yang dipegang di tangan kanan. Jenis topeng yang digunakan adalah Hudoq Urug Tingang adalah hudoq menyerupai burung enggang dengan bentuk hidung yang panjang. Pada pertunjukan tari hudoq juga diiringin dengan kesenian pertunjukan yang lain seperti tari mandau dan tari giring-giring.', 14, '2024-10-18 11:18:52', 2, 0, '1729250332_6712441cd95a1.jpg', NULL, 0),
(80, 'Ragam Budaya Nusantara', 'Nadia Ailsa N', '', 'Ragam budaya Nusantara merupakan kumpulan kekayaan budaya, tradisi, dan seni, yang beragam di seluruh Indonesia. Dari beragam musik hingga tarian, kuliner, dan adat istiadat, Nusantara mencerminkan kekayaan sejarah, kepercayaan, dan nilai-nilai yang patut dijaga dan dilestarikan.', 14, '2024-10-18 11:19:58', 2, 0, '1729250398_6712445ebfe15.jpg', NULL, 0),
(81, 'Kekayaan Tradisi Budaya Nusantara ', 'Ahmad Zian Paradis', '', 'Poster in mengajak kita semua untuk tidak hanya banga akan budaya Nusantara, tapi juga kreatif dalam melestarikannya dengan menjadikan teknologi sebagai jembatan antara masa lalu dan masa depan. Tradisi bisa terus hidup, berkembang. dan menginspirasi generasi mendatang, tapa harus kehilangan akar budayanya.', 13, '2024-10-18 11:20:55', 2, 0, '1729250453_6712449589289.png', NULL, 0),
(82, 'Wae Rebo Desa Diantara Bintang', 'Winatra Wicaksana ', '', 'Indonesia dapat kabar baik beberapa waktu lalu dengan ditetapkannya Desa Wae Rebo, NTT sebagai salah satu desa terindah kedua di dunia pada tahun 2024. Dengan semangat \"Lestari Alam Asli Indonesia\", saya mengadaptasi pesona Desa Wae Rebo pada ilustrasi ini dengan menampilkan panorama alamnya yang cantik, rumah adat Mbaru Niang yang ikonik, dan Mamak Wae Rebo yang sedang menenun Tenun Manggarai.\r\n', 14, '2024-10-18 11:21:02', 2, 0, '1729250462_6712449e1ce09.jpg', NULL, 0),
(83, 'PUSAKA ABADI TAK LEKANG OLEH ZAMAN ', 'Komang Ayu Shania Virgina Wulan', '', 'Poster ini menggambarkan kekayaan budaya dan wrisan luhur Nusantara\r\ndengan menampilkan berbagai elemen pusaka tradisional seperti rumah adat, candi Borobudur, Wayang, Baju adat,dan sebagainya,\r\nyang diintegrasikan\r\ndengan simbol-simbol teknologi dan digitalisasi yang menciptakan sinergi antara identitas bangsa dan teknologi. Poster ini mengajak masyarakat untuk mengakui pentingnya warisan budaya sebagai pilar\r\nkekuatan bangsa yang tidak akan pudar oleh zaman era modern ini. Dengan semangat Nasionalisme menjadikan Pusaka Abadi yang tak lekang (hilang/pudar) oleh zaman serba teknologi ini. Elemen visual utama dalam poster ini adalah ilustrasi robot di pusat, melambangkan teknologi yang menjadi pusat globalisasi, dengan cahaya memancar yang menampilkan keragaman budaya Indonesia. Cahaya ini menggambarkan bagaimana teknologi, seperti HP, Laptop, dan Ipad yang ada sekitarnya, berfungsi sebagai alat untuk mendokumentasikan\r\ndan melestarikan budaya bangsa. Bendera Merah Putih yang\r\nmengelilingi komposisi menjadi\r\nsimbol persatuan dan kekuatan Indonesia dalam menjaga identitas budaya di tengah arus global yang kuat.\r\nElemen Cyborg di bagian samping melambangkan perpaduan manusia dengan teknologi, memberi pesan tentang pentingnya penggunaan teknologi yang bertanggung jawab, Palet warna cerah seperti biru dan ungu menggambarkan teknologi dan globalisasi, sementara warna tradisional seperti merah, kuning, dan hijau merepresentasikan Indonesia. Di seni serta budaya bagian bawah, pantun digunakan sebagai simbol \"bunga bahasa,\" menekankan pentingnya pelestarian bahasa Indonesia di era digital. Poster ini dibuat menggunakan\r\nsoftware Procreate dan\r\nPhotoshop.', 13, '2024-10-18 11:33:47', 1, 0, '1729251227_6712479be99b2.jpg', NULL, 0),
(84, 'Jika Bebek Jadi Cendrawasih', 'Ade Bagaskara', '', 'Poster ini menggambarkan seorang anak ceria menaiki bebek berbulu cendrawasih, simbol keindahan fauna Nusantara. Dengan latar belakang lanskap tropis dan bunga eksotis, anak tersebut terpesona dalam dunia khayal yang. dipenuhi keajaiban. Karya ini merayakan semangat petualangan dan keberagaman budaya serta alam Nusantara.', 14, '2024-10-18 11:36:25', 2, 0, '1729251385_67124839dc60b.jpg', NULL, 22),
(85, 'Merajut Kembali Benang Budaya', 'Putu Helina Saputri, Nengah Ghina, Nabilatul Hairat, Anjelina Arfat, Desak Ayu Nadya Sasikirana, Amaliatul Jannah', '', 'Merajut Kembali Benang Budya merupkan upaya untuk memulikan dan memperkuat warisan budaya yang mulai terurai oleh waktu.', 14, '2024-10-18 11:40:42', 2, 0, '1729251642_6712493aee254.jpg', NULL, 0),
(86, ' \"AKULAH PENJAGAMU\", TENUN & TRADIAL, WARISAN ABADI', 'Ni Nyoman Sri Witari', '', 'Deskripsi\r\nKarya yang berjudul *Akulah Penjagamu, tenun & tradial, Warisan Abad:* mengangkat tema tentang palestarian kain tenun sebagat baslan tradial tali pans kava de prat, rotif tok herere n eater van dalam pelestariannya. Bertujuan untuk menyampaikan kepada knalayak untuk komit menjaga dan mengembangkan warisan tradisi. Kain tenun yang ditampilkan pada karya ini adalah tenun songket benant yang hinesa kini berkembang pesat. di beberapa wilayah Ball seperti di daerah Jembrana dan Karangasem. Motif dan bahan kain tenun in memiliki kekhasan dibandingkan kain tenun songket jenis lain yang ada di daerah Bali yang umumnya menggunakan benang emas yang pada masa lalu melam-bangkan kemakmuran dan eksklusivitas.\r\nRelasi tenun songket dengan tradisi budaya masyarakat Bali dan kaum perempuan sangatlah kuat.\r\nDalam kultur sosialnya, perempuan Bali adalah garda utama yang menjaga tradisi kain songket benang ini, baik dalam lingkup perannya sebagai pelaku atau penenunnya, maupun sebagal subjek yang gear menggunakan bahan ini pada setiap kegiatan untuk mempercantik penampilan. Kedua variabel ini saling bergantung dan menguatkan. Hal inilah yang menjadi dasar visualisasi karya ini, sehingga menampilkan intensitas motif tenun songket benang sebagai latar dan sosok perempuan\r\nBali dengan mahkotanya secara berimbang, sebagai representasi \" eratnya ikatan\" keduanya.', 13, '2024-10-18 11:47:03', 3, 0, '1729252023_67124ab7b0f5a.jpg', NULL, 0),
(87, 'Di Ma Bumi Dipijak, DI Situ Langlk Dijunjuang', 'Annisa Awra Syafitri', '', '\"Di Ma Bumi Dipijak, Di Situ Langik Dijunjuang.\" yang memiliki makna Di mana bumi dipijak, di situ langit dijunjung, seperti Jam Gadang yang berdiri kokoh di Bukittingel, kita pun harus berdiri teguh dalam memegang nilai-nilai budaya dan kearifan lokal, sambil tetap terbuka pada perubahan dan perkembangan zaman.', 14, '2024-10-18 11:47:26', 2, 0, '1729252046_67124acec7432.jpg', NULL, 0),
(88, 'Pendalungen ', 'Arif Wicaksono Sandi', '', 'Pendalungan adalah sebutan bagi masyarakat wilayah tapal kuda di Jawa Timur. Meliputi daerah Pasuruan, Probolinggo, Jember, Situbondo, dan Bondowoso. Orang-orang pendalungan adalah masyarakat multi etnis. Kehidupan mereka terpengaruh dari akulturasi kebudayaan etnis populer disana yaitu kebudayaan Jawa dan madura. Kesenian, dan tradisi sangat kental akan pengaruh budaya jawa dan madura. Kondisi geografis wilayah pendalungan hampir seragam. meliputi bentang alam pantai dan gunung. Selamat anda telah mengenal kami, masyarakat pendalungan ', 13, '2024-10-18 11:52:19', 1, 0, '1729252339_67124bf38394d.jpg', NULL, 0),
(89, 'Kesungguhan di Setiap Langkah', 'Ari Fitrah Ardiyansyah (curated by curator)', '', '\"Yen Metu Kudu Sing Mempeng* mengajak kita untuk menghadapi tantangan dan usaha dengan kesungguhan dan dedikasi, mencerminkan nilai luhur yang menjadi warisan budaya. Dengan semangat yang membara, setiap usaha yang dilakukan akan membuahkan hasil, membawa makna lebih dalam pada perjalanan hidup kita.', 14, '2024-10-18 11:56:45', 2, 0, '1729252605_67124cfda7ead.jpg', NULL, 0),
(90, 'TARI GABYONG', 'Dewi Rengganis Setiawan', '', 'Tari Gambyong merupakan tarian yang berasal dari Jawa tepatnya Jawa Tengah, tarian in menampilkan gerakan yang anggun dan lembut dilringi dengan musik gamelan. Awalnya tarian ini berasal dari bagian tari rakyat Tarub, namun tari Gambyong diangkat ke keraton dan gerakannya diperhalus serta terstruktur.', 13, '2024-10-18 12:00:44', 1, 0, '1729252844_67124dec86c35.jpg', NULL, 0),
(91, 'Batik Membawa Sinar Bagi Generasi Muda', 'Belva Fithriyah Salsabilla', '', 'Kata \"Bangga\" dan \"Cinta\" menjadi highlight dari kalimat \"Bangga melestarikan\r\nBatik, Cinta pada Warisan Nusantara\", \"Bangga\" merupakan sebuah tindakan yang menunjukkan rasa hormat dan penghargaan pada batik. Sedangkan \"Cinta* sendiri merujuk pada rasa kasih sayang dan tanggung jawab untuk merawat dan melestarikan warisan budaya khususnya pada batik.', 14, '2024-10-18 12:04:43', 2, 0, '1729253083_67124edb92548.jpg', NULL, 22),
(92, 'KERIS JAWA', 'Muhamad Ro\'is Abidin  ', '', '\r\n\r\nKeris merupakan senjata tradisional Nusantara. Selama sejarahnya yang panjang, keris telah meninggalkan fungsi utamanya sebagai senjata dan lebih menekankan peran sosial dan nilai-nilai simbolis dari tatanan dan tuntunan masyarakat Nusantara yang dikemas dengan indah. Oleh karena itu, setiap elemen budaya keris memiliki makna yang mendalam sesuai dengan kebutuhan hidup individu, sosial, adat-istiadat, dan spiritual. Kata-kata yang ada di dalam poster ini merupakan nama-nama bagian dari keris dari wjung ke wjung. Pola persilangan dan perpaduan\r\nwarna merupakan representasi dari ragam elemen budaya yang ada di Indonesia', 13, '2024-10-18 12:05:26', 1, 0, '1729253126_67124f069bff2.jpg', NULL, 0),
(93, 'Masa dan Aksara ', 'Muhammad Ainur Rokhim ', '', '\r\nAksara Jawa merupakan salah satu kekayaan budaya Nusantara yang harus dilestarikan. Aksara ini memiliki sejarah panjang dan telah digunakan oleh masyarakat Jawa selama berabad-abad. Aksara Jawa juga merupakan sarana penting untuk melestarikan bahasa dan budaya Jawa.', 13, '2024-10-18 12:10:04', 1, 0, '1729253404_6712501ca489d.jpg', NULL, 0),
(94, ' Ayo Bantengan ', 'Muhammad Widyan ardani', '', 'Kesenian bantengan anak-anak yang berasal dari Jawa Timur, dengan karakter ceria dan gerakan dinamis, dapat dipadukan dengan gaya desain modern seperti Memphis dan Naivisme untuk menciptakan poster yang unik dan penuh energi. Gaya Memphis dengan warna-warna cerah dan pola geometris berani memberi dimensi modern yang eklektik, sementara Naivisme menambahkan kesederhanaan dan spontanitas melalui bentuk-bentuk yang imajinatif dan polos. Kombinasi in menghasilkan poster yang tidak hanya memadukan unsur-unsur tradisi lokal dengan visual kontemporer, tetapi juga memberikan kesan playful dan dinamis, cook untuk menarik perhatian\r\naudiens anak-anak dengan perpaduan warna cerah, tekstur, dan elemen visual yang harmonis.', 13, '2024-10-18 12:14:12', 1, 0, '1729253652_67125114b7be0.png', NULL, 0),
(95, 'Demi Masa', 'Juarasebelas (curated by curator)', '', 'Dari ribuan variabel, dari ratus-ribuan kemungkinan, dari jutaan kehidupan, dari milyaran siggungan interaksi, terlahir Pusaka yang menjadi guratan peradaban manusia.', 14, '2024-10-18 12:17:04', 2, 0, '1729253824_671251c09c6de.jpg', NULL, 0),
(96, 'Bukan Sekedar Batik', 'Fajar Januardy', '', 'Poster ini menampilkan elemen batik Khas Nusantara yang dimodifikasi dengan sentuhan modern, menciptakan kesan ceria. Pola tradisional dipadukan dengan warna-warna cerah. Motif batik yang dinamis seolah bergerak di latar belakang bersih, menonjolkan keindahan dan kreativitas karya ini. Poster ini merayakan warisan budaya Indonesia Sambil mengajak penikmatnya menikmati batik dalam suasana yang menyenangkan.', 14, '2024-10-18 12:23:28', 2, 0, '1729254208_671253408419a.jpg', NULL, 0),
(97, 'Membatik Menjaga Warisan', 'Hanny Apriliani', '', 'Pentingnya belajar membatik untuk melestarikan warisan budaya dan mengajak generasi muda untuk ikut serta menjadi bagian regenerasi pembatik.', 14, '2024-10-18 12:32:18', 2, 0, '1729254738_67125552a9a8e.jpg', NULL, 22),
(99, 'Jalan Menuju Keabadian ', ' Andi Baetal Mukadas', '', 'Suku Toraja yang mash menganut kepercayaan \"allu to dolo\"\r\n(ajaran orang dulu) mereka meyakini semakin banyak kerbau yang di potong maka arwah si mayit akan lebih cepat sampai ke Alam Puya ( surga), dan mereka yang telah meninggal akan dibuatkan tau-tau sebagai penanda. Setiap sat mereka hadir dipemakaman untuk membersihkan tengkorak mayat dalam tradisi ma\'nene. ritual di mana mayat yang berusia puluhan bahkan ratusan tahun yang lalu dikeluarkan dari dalam liang kuburan untuk dibersihkan dan diganti baju dan kainnya', 13, '2024-10-18 12:39:56', 1, 0, '1729255196_6712571c73df0.jpg', NULL, 0),
(100, 'Ngaos Mamaos Maenpo', 'Irpan Alfian (curated by curator)', '', 'Di era modernisasi yang pesat, kebudayaan tradisional seringkali menjadi hal yang terkesampingkan dan terlupakan. Khususnya di Cianjur memiliki tiga pilar budaya utama yakni: Ngaos, Mamaos, dan Maenpo. Ngaos adalah kegiatan membaca dan memahami Al-Qur\'an, yang mengajarkan nilai-nilai spiritual dan moral. Mamaos adalah seni tembang Sunda, yang membawa kita pada keindahan seni dan tradisi.\r\nMaenpo adalah seni bela diri tradisional, yang membentuk disiplin dan keberanian.\r\n\r\nNamun, tingkat kesadaran masyarakat terhadap warisan budaya ini semakin menurun. Dengan karya in diharapkan menjadi sebuah upaya pelestarian Ngaos, Mamaos, dan Maenpo sebagai identitas budaya Cianjur yang harus dijaga.\r\nPartisipasi aktif kita dalam mempraktikkan dan mengajarkan ketiga pilar in adalah kunci untuk mempertahankan dan menghidupkan kembali kebudayaan Cianjur.\r\n\r\nDeskripsi Visual\r\n\r\nWarna: Hitam, Emas dan hijau sebagai identitas dan nuansa Cianjur. Warna hijau melambangkan kesuburan dan kehidupan, sementara warna hitam dan emas memberikan kesan elegan yang bervalue.\r\nFont: TXC Pearl Regular, dengan karakteristik humanis mencerminkan arti dari tiga pilar Cianjur - keindahan, kekuatan, dan spiritualitas.\r\n\r\nMotif: Motif batik khas Cianjur, yakni motif batik hayam pelung memberikan sentuhan tradisional yang autentik.\r\n\r\nIlustrasi: Goresan ilustrasi organik yang menggambarkan elemen-elemen dari\r\nNgaos, Mamaos, dan Maenpo, menambahkan kesan dinamis dan hidup. Goresan ini menciptakan harmoni visual yang memperkuat pesan pelestarian budaya.', 14, '2024-10-18 12:40:42', 2, 0, '1729255242_6712574a8b348.jpg', NULL, 0),
(101, 'Pelengkap Kesempurnaan ', ' Andi Taslim Saputra', '', 'Dalam kehidupan, manusia dengan segala kompleksitasnya seringkali mencari makna dan\r\nkeindahan untuk menemukan titik ketenangan. Ketika manusia dan badik berpadu, terciptalah\r\nharmoni antara kekuatan fisik dan kedalaman Jiwa. Manusia menggunakan badik tidak hanya\r\nuntuk mempertahankan diri, tetapi juga hadir dalam jiwanya sebagai alat ritual untuk melanggengkan ke-tradisi-an, menegaskan hubungan antara keberanian dan kebijaksanaan.', 13, '2024-10-18 12:41:03', 1, 0, '1729255263_6712575f30677.jpg', NULL, 0),
(102, 'THE ANCIENT TRACES OF SUMPANG BITA', 'Hasbi', '', 'Taman Purbakala Sumpang Bita adalah tempat yang berharga untuk eksplorasi dan penelitia\r\nPentingnya pelestarian sejarah dan budaya di situs ini tidak dapat dipandang sebelah mata, hal tersebut berkontribusi dalam membangun masa dean yang lebih baik Menggali dan memahami warisan prasejarah, kita tidak hanya menghargai apa yang telah ada, tetapi juga menyiapkan dir untuk menghadapi tantangan yang akan datang dengan penuh kesadaran dan rasa tanggung jawab.', 13, '2024-10-18 12:43:24', 1, 0, '1729255404_671257ec960fa.jpg', NULL, 0),
(103, '\"Rawali\" Persaudaraan Tak Akan Mati ', 'Muhammad Suyudi', '', 'Di dalan kultur Bugs Makassar Sangatlah menjunjung tinggi rasa persaudaraan. Istilah Kawali dalam bahasa Bugs dapat diartikan sebagai bagian sebelah.\r\n• Secara bentuk bagian in membutuhkan\r\nbagian yang disebelahnya lagi untuk menjadi sempurna atau utuh. Dalam kepercayaan suku Bugs kata Kawali merupakan simbolisasi persaudaraan di dalam bentuk benda.', 13, '2024-10-18 12:46:18', 1, 0, '1729255578_6712589a5b1ba.jpg', NULL, 0),
(104, 'Roket Indonesia Maju ', 'Karta Jayadi', '', 'Budaya sebagai kekuatan menuju kemajuan masa depan merujuk pada bagaimana cerita, tradisi, nilai, dan identitas suatu bangsa tau masyarakat dapat menjadi pendorong utama dalam membentuk masa depan yang lebih baik. Budaya bukan hanya soal warisan sejarah atau adat, tetapi juga alat yang dinamis untuk menghadapi tantangan global. Dengan mengedepankan nila-nilai budaya, masyarakat dapat menemukan inovasi, solidaritas, dan kebanggaan yang memperkuat identitas mereka di era modern.', 13, '2024-10-18 12:47:21', 1, 0, '1729255641_671258d979c72.jpg', NULL, 0),
(107, 'Segerombolan Kata Kunci', 'Jaisy Shafa Nadirah (curated by curator)', '', 'Poster ini menampilkan sekumpulan kata kunci yang merangkum esensi Nusantara. Dalam desain yang minimalis namun kuat, kata kata tersebut tersusun rapi dan saling berinteraksi, menciptakan kesan dinamis. Latar Belakang yang sederhana memastikan fokus tetap pada kata-kata. menggambarkan kekayaan dan kedalaman budaya serta alam Indonesia. Poster ini bberfumgsi sebagai pengingat akan pentingnya menghargai dan melestarikan kekayaan yang ada di Nusantara.', 14, '2024-10-18 12:55:05', 2, 0, '1729256105_67125aa9dc07b.jpg', NULL, 0),
(108, 'Hayu Urang Ameng', 'Revi Larisa (Curated by curator)', '', 'Congklak is not just a game, but a reflection of a long journey and is rich in history and culture. From tradition to Entertainment, Congklak continues to be an ineparable part of people\'s lives, teaching us about wisdom, strategy, and the beauty of cultural heritage that must be carefully protected.', 14, '2024-10-18 13:09:44', 2, 0, '1729256984_67125e18de62b.jpg', NULL, 0),
(110, 'Kakawih Sutasoma', 'Tegar Januardy Johan (curated by curator)', '', '', 14, '2024-10-18 13:13:59', 2, 0, '1729257239_67125f17d4425.jpg', NULL, 0),
(111, 'Jati Diri', 'Umi Nur Jannahtillah (curated by curator)', '', 'Deskripsi Keris adalah senjata dengan kekuatan supranatural dalam budaya Jawa, tetapi ada pepa- tah yang menyatakan bahwa \"Pusaka yang paling sakti bukanlah tombak, pedang, atau keris, melainkan terletak dalam diri sendiri.\" Ini menunjukkan bahwa keris berfungsi se- bagai perantara untuk mengakses kekuatan yang ada dalam diri, sementara kekuatan sejati berasal dari jati diri dan keyakinan individu', 14, '2024-10-18 13:14:17', 2, 0, '1729257257_67125f29515bc.jpg', NULL, 0),
(112, 'Lima Raut Satu Kisah ', 'Yumna Aufa K  (curated by curator)', '', 'Karya \"Lima Raut Satu Kisah” ini menyajikan lima topeng tradisional Tari Topeng Cirebon yang di reinterpretasi dari elemen topeng (edanpoststudio) sebagai dasar, dengan perubahan sedikit detail dan proporsi yang lebih sesuai dengan tema poster yang saya buat. Masing-masing topeng ini mewakili fase kehidupan manusia. Melalui raut wajah ini memberikan pelajaran hidup tersendiri, namun bersama-sama mereka membentuk satu kisah besar : sebuah narasi kehidupan yang penuh makna bagi kita semua.', 14, '2024-10-18 13:27:12', 2, 0, '1729258032_67126230b5142.jpg', NULL, 0),
(114, 'KAZAGURUMA', 'KOICHI SAKAMOTO', '@shodouka_cou', '', 21, '2024-10-18 13:57:19', 1, 0, '1729259839_6712693f1438f.JPG', NULL, 0),
