(141, 'IKN Sutasoma Specimen Prototype', 'Aulia Akbar dan Tim', '@spacelessmind, @potbrandinghouse', '', 12, '2024-10-18 14:33:45', 1, 0, '1729262025_671271c9ec0d3.jpg', NULL, 0),
(142, '\"Keanggunan Badik : Senjata dan Simbol Budaya\"', 'Wahyu Wardana Rasyid', '', 'Suku Bugis sangat menjunjung nilai-nilai Siri Na Pacce. Badik merupakan senjata khas suku Bugis\r\nPoster ini menggambarkan keindahan dan keunikan badik sebagai senjata tradisional Suku Bugis\r\nDengan latar belakang warna cerah yang elegan, desain ini menonjolkan gambar badik yang\r\nterletak di tengah, menunjukkan detail bilah melengkung dan ukiran pada pegangan yang\r\nmencerminkan keterampilan pengrajin', 13, '2024-10-20 03:48:41', 1, 0, '1729396121_67147d99c40f0.jpg', NULL, 0),
(143, 'PHINISI BERLABUH', 'Andi Fauziyah Hijrina Fatimah', '', 'Kapal Phinisi merupakan kapal layar tradisional yang diwariskan secara turun temurun di masyarakat Bugis, Sulawesi Selatan, tepatnya dari Kabupaten Bulukumba. Kapal Phinisi merupakan ikon dari keberanian dan kegigihan para pelaut Bugis yang mengarungi bentangan samudera yang luas. Dahulu, Phinisi dijadikan sebagai transportasi untuk membawa rempah-rempah ke berbagai daerah maupun negara, dan saat ini Phinisi dimanfaatkan sebagai kapal wisata untuk memperlihatkan keindahan- keindahan pemandangan laut yang ada di Indonesia, seperti di Raja Ampat dan Labuan Bajo. Perjalanan bersama Phinisi ada saatnya ia terhenti, melepaskan jangkar, dan berlabuh. Berlabuh bukan tentang akhir perjalanan, tapi tentang meresapi makna dari setiap langkah yang telah dilalui. Melintasi bentangan samudera yang luas pasti memiliki cerita dan pengalaman tersendiri. Berlabuh adalah momen ketenangan setelah badai, waktu untuk merenung dan menemukan arti dari perjalanan itu sendiri. Ia mengajarkan kita bahwa perjalanan bukan hanya tentang pencapaian akhir, tetapi juga tentang proses, pertumbuhan, dan semua pengalaman yang dilalui di sepanjang jalan', 13, '2024-10-20 03:52:45', 1, 0, '1729396365_67147e8d92782.jpg', NULL, 0),
(144, 'Budaya Belajar Baru', 'Faidhul Inayah, M.Sn.', '', 'Mie instan telah menjadi makanan turun-temurun yang enak, mengenyangkan, dan mudah didapatkan dengan harga terjangkau. Kepraktisan mie instan mirip dengan penggunaan ChatGPT dalam dunia pendidikan, di mana pelajar menggunakannya untuk mengerjakan tugas. Penggunaan ChatGPT terkesan cepat, praktis, dan tidak menyulitkan manusia untuk berpikir, sehingga ia berpotensi menggantikan peran pemikiran manusia. Pertanyaannya apakah ini akan menjadi budaya baru?', 13, '2024-10-20 03:56:01', 1, 0, '1729396561_67147f51ad34f.jpg', NULL, 0),
(145, 'Merajut Kembali Benang Budaya', 'Putu Helina Saputri, Nengah Ghina Nabilatul Hairat, Anjelina Arfat, Desak Ayu Nadya Sasikirana, Amaliatul Jannah', '', 'Merajut Kembali Benang Budya merupkan upaya untuk memulihkan dan\r\nmemperkuat warisan budaya yang mulai terurai oleh waktu.', 13, '2024-10-20 04:03:56', 2, 0, '1729397036_6714812cd41cd.jpg', NULL, 0),
(146, 'Refleksi Makassar', '', '', '', 13, '2024-10-20 04:17:27', 1, 0, '1729397847_6714845734027.jpg', NULL, 0),
(147, 'Dice', 'Paksi Studio', '', '', 13, '2024-10-20 04:20:28', 0, 0, '1729398028_6714850cd3b1e.jpg', NULL, 0);
