INSERT INTO `speakers` (`id_speaker`, `nama_speaker`, `instansi`, `deskripsi`, `kontak`, `foto_speaker`, `created_at`, `urutan`, `updated_at`) VALUES
(5, 'Aulia Akbar', 'PotBranding House', 'Perkenalkan,\r\n\r\nAulia Akbar, seorang desainer grafis yang berdomisili di Bandung. Dengan pengalaman dan rekam jejak yang terbukti di Industri desain grafis, saat ini ia menjabat sebagai desainer dan mitra di POT Branding House, serta merupakan anggota aktif ADGI (Asosiasi Desainer Grafis Indonesia). Aulia Akbar memiliki peran penting dalam penciptaan logo Pohon Hayat yang kini menjadi logo IKN. Pengalaman selama 10 tahun di Industri ini, Ia meyakini bahwa setiap desain memiliki tempatnya sendiri dan melayani tujuan yang unik. Oleh karena itu, setiap karyanya selalu dimulai dengan mempertimbangkan bagaimana desain tersebut akan sesuai dengan konteks sosial dan budaya.\r\n\r\nMemiliki Riwayat Karir Sebagai,\r\n\r\n- POT Branding House, Graphic Designer\r\n(2015 - 2017)\r\n- Senior Graphic Designer\r\n(2017 - 2019)\r\n- Head of Design\r\n(2019 - 2021)\r\n- Art Director\r\n(2022 - 2023)\r\n- Partner, Design Researcher\r\n(2023 - Present)\r\n- Graphic Designer at TABO Design & Build; Construction\r\n(2020 - Present)\r\n- Principal Mentor Graphic Design at Pixel Ninja by Telkomsel\r\n(2022 - Present)\r\n- Co-Owner & Graphic Designer at MOHOI (Morotai Home Indonesia)\r\n- Co-Founder & Brand Director Akača Manifesto Journal', '@spacelessmind', 'Aulia Akbar_1726378153.png', '2024-09-15 05:29:13', 1, '2024-10-16 04:14:48'),
(6, 'Raden Fikri Hendaputra', 'Founder Serving Idea - Graphic Designer', 'Perkenalkan,\r\n\r\nRaden Mohammad Fikri Hendraputra adalah seorang desainer grafis dan pendiri Serving Idea, sebuah studio konsultan yang saat ini membantu klien dalam hal branding dan desain. Sejak masa kuliah, Raden Fikri sudah aktif mengerjakan berbagai proyek di bidang desain grafis, memperkuat keterampilannya dalam menciptakan identitas visual yang kuat bagi berbagai merek. Selain menjalankan studio tersebut, ia juga pernah menjadi seorang asisten dosen di Universitas Pendidikan Indonesia, di mana ia berbagi ilmu dan pengalaman dengan mahasiswa di bidang desain dan komunikasi visual. \r\n\r\nMemiliki Riwayat Karir Sebagai,\r\n\r\n- Founder (Ceo/Creative Director) Serving Idea\r\n2023 - Present\r\n- Lecturer Assistant at Universitas Pendidikan Indonesia\r\n2022 - 2023\r\n- Intern Graphic Designer at Bandung Design Biennale\r\n2021\r\n- Graphic Designer at Lalune Luncheonette\r\n2021\r\n- Creative Director for Boobies Jeans\r\n2021\r\n- Founder A26plus\r\n2020\r\n- Graphic Designer for Armburger\r\n2019\r\n\r\nRaden Fikri juga aktif sebagai pembicara di berbagai\r\nseminar dan talkshow yang membahas desain serta dunia\r\nkerja kreatif. Melalui berbagai kesempatan tersebut, ia\r\nberbagi wawasan mengenai branding, desain, dan\r\npengelolaan bisnis kreatif, memberikan pandangan\r\nprofesional kepada para desainer dan pegiat industri\r\nkreatif.', '', 'Raden Fikri Hendaputra_1727143044.png', '2024-09-24 01:57:24', 2, '2024-10-16 04:24:32'),
